import{_ as A,k as e,p as g,ac as l}from"./chunks/framework.DA7r4KNg.js";const n="/assets/202303131678714293417680.i2EBGSq3.png",a="/assets/202303131678714642545533.Cito9UK0.png",s="data:image/png;base64,",i="/assets/202303131678714661627866.BgRN_ahV.png",d="data:image/png;base64,",r="/assets/202303131678714693511061.CKHKbfej.png",p="data:image/png;base64,",B="/assets/202303131678714714338909.DAfqkWyF.png",o="data:image/png;base64,",x="/assets/202303131678714775704715.Dce-_W1j.png",u="data:image/png;base64,",c="/assets/202303131678715218648075.Ds3QTOqk.png",y="data:image/png;base64,",H=JSON.parse('{"title":"具体对比","description":"","frontmatter":{},"headers":[],"relativePath":"wenzhang/汉心和小鹤.md","filePath":"wenzhang/汉心和小鹤.md"}'),O={name:"wenzhang/汉心和小鹤.md"};function f(w,t,E,m,T,z){return g(),e("div",null,t[0]||(t[0]=[l('<p>新手为什么会觉得汉心像小鹤？</p><p>当新手了解下自然码，他们也会觉得像自然码。</p><p>因为这种类型的音托辅码，其实多数字根位置都是和读音对应的。否者就变成五笔了，难记。</p><p>实际上，当你了解更多辅码后，你会发现，每种辅码，都有他的设计思路，都是为了解决一个问题。</p><p>汉心，就是为了解决，不背字根还重码低的问题。原因就是作者不想记那些少见的字根。</p><ol><li><p>新手为什么会觉得汉心小鹤很像？ 字根数量少：两者都采用精简的字根集（汉心码更少），且部分常用字根重叠（如基本笔画、常见偏旁），这容易让新手产生“看起来差不多”的错觉。 新手对规则未深入理解：新手尚未掌握两者的核心取码逻辑差异，仅从表面（如拆分字形）判断相似性。</p></li><li><p>汉心码与小鹤的实质区别</p></li></ol><p>（1）取码逻辑不同 小鹤形：基于“小字”概念（即字根是否独立成字），需判断部件的字根属性，规则较复杂。 汉心码：直接取“最小字元”（无视是否成字），规则更直观，但需额外规则处理例外情况（如部分字根不拆到底）。</p><p>（2）设计思路独立 汉心码源于作者早期“易学码”的迭代，初衷是避免记忆字根，灵感来自自然码的使用体验，而非模仿小鹤。 字根位置通过重码率计算优化（用表格函数人工调整），属于数据驱动的正向设计</p><p>（3）规则风格差异，小鹤的“小字”规则虽高效，但稍有学习成本；汉心码的“最小字元”更符合直觉。 仅个别设计（如“穿插破坏不取”）参考小鹤思路，但未直接沿用。</p><ol start="3"><li><p>新手误解的深层原因 规则复杂性隐蔽：两者表面拆分结果可能部分重合，但背后的逻辑截然不同（如“你”字在小鹤中按小字拆，汉心码中可能按最小笔画拆）。 字根布局的视觉误导：常用字根位置可能因重码率优化而偶然接近，但整体分布差异较大。</p></li><li><p>汉心码的设计优势与局限 优势： 对小白友好：直接拆最小单位，无需记忆“小字”概念。 数据驱动：通过重码率优化字根位置，降低冲突概率。 局限： 需额外规则弥补“最小字元”的不足（如某些字根需保留整体）。 人工计算重码率效率低（对比编程优化）。</p></li><li><p>关于“像五笔/拼音辅码”的澄清 与五笔的区别：汉心码不追求字根全映射到英文字母（如五笔的25键设计），字根集更自由。 拼音辅码的约束：汉心码若涉及音码部分，需与读音对应，但主体形码部分独立设计。</p></li></ol><p><strong>总结</strong>， <strong>新手感觉汉心码与小鹤“像”，是因两者均为形码且字根精简，但核心规则和设计哲学差异显著。汉心码的“最小字元”取向和重码率优化策略，使其更贴近自然拆字直觉，形成独特风格。这种差异需通过深入学习规则才能体会，类似编程语言中语法相似但范式不同的情况。</strong></p><h1 id="%E5%85%B7%E4%BD%93%E5%AF%B9%E6%AF%94" tabindex="-1">具体对比 <a class="header-anchor" href="#具体对比" aria-label="Permalink to &quot;具体对比&quot;">​</a></h1><p><img src="'+n+'" alt="image。png"></p><p><strong>image。png</strong></p><table tabindex="0"><thead><tr><th style="text-align:left;"><strong>汉心码规则</strong></th><th style="text-align:left;"><strong>鹤形有没有这条规则</strong></th><th style="text-align:left;"><strong>说明:</strong></th></tr></thead><tbody><tr><td style="text-align:left;">三例外,1,字元标上有大字元,优选取大字元</td><td style="text-align:left;">鹤形没有</td><td style="text-align:left;">鹤形是取大优先好像</td></tr><tr><td style="text-align:left;">三例外,2,取不了小字元的优先取大字元</td><td style="text-align:left;">鹤形没有</td><td style="text-align:left;">鹤形是取不了就取笔画好像</td></tr><tr><td style="text-align:left;">三例外,3,最小字元遇到单笔画取组合体大字元,遇到多笔画取小</td><td style="text-align:left;">这条鹤形有个类似的,但是双方不一样</td><td style="text-align:left;">汉心码这条完全没参考鹤形。因为当时不会鹤形。这条规则诞生原因,只是都取最小字,发现重码有点多。然后,很多字强行取最小字,很不直观。所以自然而然想到这样办。</td></tr><tr><td style="text-align:left;">三不取,1,被穿插分开的不取和移不出不取</td><td style="text-align:left;">这条鹤形有类似的</td><td style="text-align:left;">这条是当时唯一记得和看懂鹤形的规则。 双方细节上不一样 ，鹤形没有移不出就不取，也没有分不开就取</td></tr><tr><td style="text-align:left;">三不取,2,变笔画的不取</td><td style="text-align:left;">鹤形没有这条规则</td><td style="text-align:left;">其实靠直观,也能分出来一部分,定义一下,会更清晰</td></tr><tr><td style="text-align:left;">三不取,3,冷僻字元不取</td><td style="text-align:left;">鹤形没有</td><td style="text-align:left;">汉心码字根少,也不区分字根。然后又要易学,所以就必须有这条规则</td></tr><tr><td style="text-align:left;">四强制,1,半包围字先左后右</td><td style="text-align:left;">鹤形有类似的</td><td style="text-align:left;">细节上不一样</td></tr><tr><td style="text-align:left;">四强制,2/3,含戈半全包围字，先取内部尾,3像戈都是戈</td><td style="text-align:left;">鹤形没有这样的规则</td><td style="text-align:left;">汉心码这条规则其实继承易学码的,因为这样类型的字很难取</td></tr><tr><td style="text-align:left;">四强制,4,发龙拔类型尾取右下，朵取几，等</td><td style="text-align:left;">鹤形还是没有</td><td style="text-align:left;">这些字容易想不起取笔顺尾码点</td></tr></tbody></table><h1 id="%E5%AD%97%E6%A0%B9%E5%AF%B9%E6%AF%94%2C%E5%B7%AE%E5%88%AB%E4%B9%9F%E5%BE%88%E5%A4%9A" tabindex="-1">字根对比,差别也很多 <a class="header-anchor" href="#字根对比%2C差别也很多" aria-label="Permalink to &quot;字根对比,差别也很多&quot;">​</a></h1><table tabindex="0"><thead><tr><th style="text-align:left;"><strong>汉心码字根</strong></th><th style="text-align:left;"><strong>鹤形字根</strong></th></tr></thead><tbody><tr><td style="text-align:left;"><img src="'+a+'" alt="image.png"><strong>image.png</strong></td><td style="text-align:left;"><img src="'+s+'" alt="image.png"><strong>image.png</strong></td></tr><tr><td style="text-align:left;"><img src="'+i+'" alt="image.png"><strong>image.png</strong></td><td style="text-align:left;"><img src="'+d+'" alt="image.png"><strong>image.png</strong></td></tr><tr><td style="text-align:left;"><img src="'+r+'" alt="image.png"><strong>image.png</strong></td><td style="text-align:left;"><img src="'+p+'" alt="image.png"><strong>image.png</strong></td></tr><tr><td style="text-align:left;"><img src="'+B+'" alt="image.png"><strong>image.png</strong></td><td style="text-align:left;"><img src="'+o+'" alt="image.png"><strong>image.png</strong></td></tr><tr><td style="text-align:left;"><img src="'+x+'" alt="image.png"><strong>image.png</strong></td><td style="text-align:left;"><img src="'+u+'" alt="image.png"><strong>image.png</strong></td></tr><tr><td style="text-align:left;"><img src="'+c+'" alt="image.png"><strong>image.png</strong></td><td style="text-align:left;"><img src="'+y+'" alt="image.png"><strong>image.png</strong></td></tr></tbody></table><p>总之，规则就没有一条完全一样的。而且大部分规则也不一样。记得以前快手码的作者,说学小鹤搞不明白,然后作了一个快手码。但是汉心码,没有这个出发点。汉心码就是想要一个不要背字根的码。然后设计了易学码,易学码重码多。然后就想整一个重码少的”易学码”,这就诞生了汉心码</p>',18)]))}const k=A(O,[["render",f]]);export{H as __pageData,k as default};
